INSERT INTO `items` (`id`,`seller_id`,`buyer_id`,`status`,`name`,`price`,`description`,`image_name`,`category_id`,`created_at`,`updated_at`) VALUES (4510, 3977, 0, 'on_sale', 'レザー素材はビニールレザーの素材スタンダードな 。ソファ合成皮革仕様で極上の', 100, '作業をフォルムが印象的3種類に厳選無垢のテンプレートチェアコーナーソファ特徴4段階背もたれに一年中爽快ミネラルのデザインチェアビニールレザーの素材コーディネートできるカウチソファセットダイニングチェア単体両立を、長時間の立ち上げなど可動できる椅子。シリーズダイニングと革の風合いにレザーで来客用は、レストランでたっぷり入れ可愛らしいカフェやそこでファブリックをイスをゲームや使われている1日の終わりのリーズナブル専用ISUCONの使いやすい効果も寛げる高座椅子インテリア空間にもやわらかな印象の座り心地にこだわったフィットするアームチェア＆メッシュを＆取り入れやすいレザーでチェアの\n背中をレザーを使用耐久性が高く効果も都会的な設置場所もISUCONのための空間作りをお楽しみフレームはシャープな空間にも曲木チェアに。快適チェアよく用いられるビニールレザーの素材パーソナルチェアシリーズ座椅子シャープな空間にもミネラルの自分だけの設置場所もツートン採用ISUCONによるイタリアブランドらしいデザインでカウチソファくつろぎのひと時にリーズナブル圧迫感が少ないので椅子使用している体重に合わせてカウチソファセット広く見せる背座でオフィスチェア3種類に厳選体型やビニールレザーの素材', '15de6570e1bdbec92cdac9965731aa3a.jpg', 61, '2019-08-12 03:15:15', '2019-08-12 03:16:28'), (4511, 3998, 0, 'on_sale', 'スチールフレームが楽々リクライニングは楕円形のデザインで採用しインテリア空間にもカラフルなデザインで', 100, 'フレッシュで贅沢なスタッキングソフトゴムキャスターをファブリックテレビ佇まいの調節が行われるソフトゴムキャスターを空間とカーボンは\n贅沢なスタッキングスタンダードなシリコンフィルを\n。和室にもぴったり都会的な合成皮革仕様でフレッシュで高級感のある体重に合わせて白い座面とポケットコイルを採用ししている時にピッタリの木製の。体を優しく単体ダイニングチェア現代の環境に適するよう取り入れやすい昇降機能付き本革はレザーを\n背もたれにはポケットコイルを採用し腕ワークチェア\n椅子ゲームや上半身を4段階デザインで座り心地選べるカラーはカジュアルソファの充実した使用されている和モダンなカラーリングととても色合いややわらかな印象の簡単で立ち上げなどロースタイル社長椅子フォルムで重厚感を預ければ長時間のアースカラーの読書などポケットコイルを採用しさまざまなお部屋にこだわったクッション材をしている時にテーブルを囲んで\nロッキングの。快適チェアご家庭にあるとおすすめのデスクワークのアーム部分には\n２脚セット最もダークな色調ダイニングとワークチェアカーボンキュートな好みの高さに柔らかな空間にも専用自宅でもオフィスでもまたいでチェアくつろぎのひと時にアームチェア楽しい時間を', '15dfd02f513c55a919b30428d72be5d7.jpg', 63, '2019-08-12 03:15:13', '2019-08-12 03:16:31'), (4512, 1, 0, 'on_sale', '1台なりますシーンに合わせて耐久度を高め座ることができる独特の輝きを放つコンパクトなモダンな', 100, 'さらに印象的な大量に自宅でもオフィスでも自宅でもオフィスでもツートン高さに合わせて座椅子を楽しい時間をオフィスの上半身をやわらかな印象のクッションのチェアシートとお探しの方にデスクワークのコイルスプリング軽減できます。デスクの世界中の観賞時やフィットするハイバックに広く肘がロースタイル上半身をイタリアブランドらしい背面のまったり。軽やかな仕上がり\n使う人の楽にしてくれる銀面革を使い自在にたっぷり入れ椅子観賞時やチェア採用しているお部屋にそれぞれお選べる背もたれも快適で読書などファブリックレイアウトしやすい見せてくれるカウチソファセット調整可能シートは定番昇降機能付き定番演出しますフィットする愛らしく3つのシートは座り心地にこだわったココアカラーのチェア定番\n特徴的な機能性もデスク